// PrivateRoute.tsx

import React from 'react';
import { Route, Redirect } from 'react-router-dom';

interface PrivateRouteProps {
  element: React.ReactNode;
  path: string;
  // Puedes agregar otras props según sea necesario
}

const PrivateRoute: React.FC<PrivateRouteProps> = ({ element: Element, ...rest }) => {
  // Lógica para verificar autenticación o permisos
  // Aquí puedes implementar tu lógica de autenticación, por ejemplo:
  const isAuthenticated = true; // Cambia esto con tu lógica real de autenticación

  return (
    <Route
      {...rest}
      render={(props) =>
        isAuthenticated ? (
          <Element {...props} />
        ) : (
          <Redirect to="/login" />
        )
      }
    />
  );
};

export default PrivateRoute;
